=======

In October 1942, Esther Stermer, the matriarch of a Jewish family in the
Ukraine, leads her family underground to hide from the pursuing Nazis - and
stays nearly a year and a half. Their harrowing story of survival living in
near total darkness in two cold, damp caves is one like no other ever told. It
was life...like no place on Earth.

In 1993, NYPD officer and caving enthusiast Chris Nicola visited Ukraine to
explore the Verteba and Priest's Grotto caves, and found evidence that they had
recently been inhabited by humans. After discovering that the caves were used
by Jews escaping The Holocaust, he embarked on a decade-long quest to find
survivors.

